      <div>
        <Row>
          <Col xs={12} md={6}>
            xs=12 md=8
          </Col>
          <Col xs={12} md={6}>
            xs=6 md=4
          </Col>
        </Row>
      </div>
    );
  }
}

export default LandingPage;
